If $a$ is inversely proportional to $b$, then the product $ab$ is a constant.  For $a_1$ and $a_2$ this implies: $$a_1\cdot b_1=a_2\cdot b_2$$We can divide both sides of this equation by $b_1\cdot a_2$ to find: \begin{align*}
\frac{a_1\cdot b_1}{b_1\cdot a_2}&=\frac{a_2\cdot b_2}{b_1\cdot a_2}\\
\Rightarrow\qquad \frac{2}{3}=\frac{a_1}{a_2}&=\frac{b_2}{b_1}\\
\Rightarrow\qquad \boxed{\frac{3}{2}}&=\frac{b_1}{b_2}
\end{align*}

Let $a$ be Andrew's age now and $g$ be his grandfather's age now. We are looking for the value of $a$. We can set up a system of two equations to represent the given information, as follows:

\begin{align*}
g &= 12a \\
g-a &= 55 \\
\end{align*}

In particular, the second equation represents the grandfather's age $a$ years ago, when Andrew was born. To solve for $a$, we need to eliminate $g$ from the equations above. Substituting the first equation into the second to eliminate $g$, we get that $12a-a=55$ or $a=5$. Thus, Andrew is $\boxed{5}$ years old now.

Using the associative property and simplifying gives \begin{align*}
(15x^2) \cdot (6x) \cdot \left(\frac{1}{(3x)^2}\right)
&= (15 \cdot 6) \cdot (x^2 \cdot x) \cdot \left(\frac{1}{9x^2}\right)\\
&= \frac{90x^3}{9x^2}\\
&= 10x^{3-2} = \boxed{10x}.
\end{align*}

Instead of expanding the entire product, we can look only at terms that will multiply to give $x^3$.  We know that: $$x^3=x^3\cdot 1=x^2\cdot x=x\cdot x^2=1\cdot x^3$$Knowing this, the $x^3$ term in the expansion will be the sum of these four terms: $$(-3x^3)(7)+(5x^2)(4x)+(-6x)(-3x^2)+(1)(2x^3)$$We simplify to find: \begin{align*}
&(-3x^3)(7)+(5x^2)(4x)+(-6x)(-3x^2)+(1)(2x^3)\\
&\qquad=-21x^3+20x^3+18x^3+2x^3\\
&\qquad=\boxed{19}x^3.
\end{align*}

At the intersection of two lines, the $x$'s are equal and the $y$'s are equal. We may set $4x - 19 = 95 - 2x$ to find an $x$, where the $y$'s are equal.

\begin{align*}
4x - 19 &= 95 - 2x \\
6x &= 114 \\
x &= \boxed{19}.
\end{align*}

