There are three intersections. The leftmost intersection lies on the line of slope $2$ through the origin, which is $y=2x$. Solving $2x=1.8$ yields $x=0.9$.

The middle intersection lies on the line of slope $-1$ through $(2,1)$, which is $y=-x+3$. Solving $-x+3=1.8$ yields $x=1.2$.

The rightmost intersection lies on the line of slope $2$ through $(2,1)$, which is $y=2x-3$. Solving $2x-3=1.8$ yields $x=2.4$.

Thus, the sum of the three $x$-coordinates is $0.9+1.2+2.4=\boxed{4.5}$.

The number of workers will be inversely proportional to the time needed to complete the job.  This means that the product $(\text{number of workers})\times(\text{days to complete job})$ will be a constant.  In this case, that constant will be: $$4\times 1.25=5$$ For three workers, the product will remain the same.  Let $D$ equal the number of days needed for three workers to complete the job.  Then, \begin{align*}
3\times D&=5\\
\Rightarrow\qquad D&=5/3=\boxed{1\frac{2}{3}} \text{work-days}.
\end{align*}

We have \begin{align*}
(n-1) \cdot n &\cdot (n+1) \cdot (n+2) \cdot (n+3)\\
&= (2-1) \cdot 2 \cdot (2+1) \cdot (2+2) \cdot (2+3) \\
&= 1 \cdot 2 \cdot 3 \cdot 4 \cdot 5,
\end{align*} which is equal to $5!$, or $\boxed{120}$.

We could also multiply the last expression out by hand: \begin{align*}
(1 \cdot 2 \cdot 3) \cdot 4 \cdot 5 &= 6 \cdot 4 \cdot 5 \\
&= 6 \cdot 20 \\
&= 120 .
\end{align*}

