problem:
Let \[f(x) = \left\{
\begin{array}{cl}
-x - 3 & \text{if } x \le 1, \\
\frac{x}{2} + 1 & \text{if } x > 1.
\end{array}
\right.\]Find the sum of all values of $x$ such that $f(x) = 0$.

solution:
Because the point for which we are looking is on the $x$-axis, we know that it is of the form $(x, 0)$. We apply the distance formula. The distance from A is  \begin{align*}
\sqrt{(-2-x)^2+(0-0)^2} &= \sqrt{x^2+4x+4}
\end{align*} The distance from B is  \begin{align*}
\sqrt{(0-x)^2 + (4-0)^2} &= \sqrt{x^2+16}
\end{align*} Because the point is equidistant from A and B, we set the two distances equal: $x^2+4x+4 = x^2 + 16$. Simplifying gives us $4x = 12$, or $x = \boxed{3}$.

First, we use the distributive property to expand the first two factors:

\begin{align*}
4(x-5)(x+8) &= (4\cdot x - 4 \cdot 5) (x+8)\\
&=(4x-20)(x+8)
\end{align*}We use the distributive property again by adding the product of $4x-20$ and $x$ to the product of $4x-20$ and 8:

\begin{align*}
(4x-20)(x+8) &= (4x-20) \cdot x +(4x-20) \cdot 8\\
&= x(4x-20) + 8(4x-20)
\end{align*}
We use the distributive property again and combine like terms:

\begin{align*}
x(4x-20) + 8(4x-20) &= 4x^2 - 20x + 32x - 160\\
&= \boxed{4x^2 + 12x - 160}
\end{align*}

When graphed, this function is a parabola that opens upwards. Thus, the minimum possible value of y occurs at the vertex of the parabola. The $x$ coordinate of the vertex is $\frac{-b}{2a}$. Substituting the given values, this yields $\frac{-10}{2}=-5$. Substituting this for $x$ gives the minimum value of $y$ to be \begin{align*}
y&=x^2+10x+21 \\
&=(-5)^2+10(-5)+21 \\
&=25+(-50)+21 \\
&=25-50+21 \\
&=-25+21 \\
&=\boxed{-4}
\end{align*}

