problem:
If $x=2$ and $y=3$, express the value of the following as a common fraction: $$
\frac
{~\frac{1}{y}~}
{\frac{1}{x}}
$$

solution:
The area of the large rectangle is $(x+7)(x+5)$, and the area of the hole is $(2x-3)(x-2)$. To get our answer, we subtract the area of the hole from the area of the large rectangle. \begin{align*}
(x&+7)(x+5)-(2x-3)(x-2)\\
&=x(x+5)+7(x+5)-2x(x-2)+3(x-2)\\
&=x^2+5x+7x+35-2x^2+4x+3x-6\\
&=\boxed{-x^2+19x+29}.
\end{align*}

An $x$-intercept is a point on the graph that lies on the $x$-axis, so $y = 0$.  When $y = 0$, $x = 3$, so $a = 3$.

A $y$-intercept is a point on the graph that lies on the $y$-axis, so $x = 0$.  Hence, the $y$-intercepts correspond to the real roots of the quadratic equation $2y^2 - 6y + 3 = 0$.  By Vieta's formulas, the sum of the roots of this quadratic is $6/2 = 3$, so $b + c = 3$.

