Let $p$ be the number of Popsicles Megan can finish in 4 hours and 30 minutes. If we convert that period of time into minutes, we find that 4 hours and 30 minutes is equal to $(4)(60)+30=270$ minutes. From here, we can set up the proportion  \begin{align*} \frac{x}{270}& =\frac{1}{15}
\\\Rightarrow \qquad x& =\left(\frac{1}{15}\right)(270)
\\\Rightarrow \qquad x& =\boxed{18}
\end{align*}

Margo walked for a total of $10+20=30$ minutes, or 0.5 hours.  To find the total distance traveled, we can multiply the total time by the rate: \begin{align*}
\text{distance}&=\text{rate}\times \text{time} \\
&=0.5\times 4 \\
&=\boxed{2}\text{ miles}.
\end{align*}

problem:
Let \[f(x) = \left\{
\begin{array}{cl} x^2-4 & \text{ if }x < 7, \\
x-13 & \text{ if } x \geq 7.
\end{array}
\right.\] What is $f(f(f(17)))$?

solution:
Substitute 5 for $b$ in the expression defining $a*b$ to find that $a*5=2a-25$.  Setting this equal to 9, we find  \begin{align*}
2a-25&=9 \implies \\
2a&=34 \implies \\
a&=\boxed{17}.
\end{align*}

problem:
Let \[f(x) =
\begin{cases}
9x+4 &\text{if }x\text{ is an integer}, \\
\lfloor{x}\rfloor+5 &\text{if }x\text{ is not an integer}.
\end{cases}
\]Find $f(\sqrt{29})$.

solution:
We can find $x$ by adding twice the first equation to five times the second. From \begin{align*}
2(3x-5y)+5(7x+2y)&=6x+35x\\&=41x,
\end{align*}and \begin{align*}
2(3x-5y)+5(7x+2y)&=2(-1.5)+5(4.7)\\&=-3+23.5\\&=20.5,
\end{align*}we find that $41x = 20.5$, or $x=0.5.$

Substituting into the second equation, we can find $y:$ \begin{align*}
7x+2y&=4.7 \\ \implies y&=\frac{1}{2}(4.7-7x)\\&=\frac{1}{2}(4.7-3.5)\\&=\frac{1}{2}(1.2)\\&=0.6.
\end{align*}Thus our answer is $\boxed{(0.5,0.6)}.$

