Refer to the above diagram.  Since the opposite ends of a diameter are symmetric with respect to the center of the circle, we must travel the same distance and direction from $(-1,-1)$ to $(2,3)$ as we do from $(2,3)$ to the other endpoint.  To go from $(-1,-1)$ to $(2,3)$ we run $3$ (left dashed red line) and rise $4$ (left dashed blue line), so our other endpoint has coordinates $(2+3,3+4)=\boxed{(5,7)}$.

Let Amy's, Ben's, and Chris's ages be $a$, $b$, and $c$, respectively. We have the equations \begin{align*} \tag{1}
\frac{a+b+c}{3}=9 \Rightarrow a+b+c&=27 \\ \tag{2}
c-4&=a\\ \tag{3}
b+3&=\frac{2}{3}(a+3)
\end{align*} From Equation (3), we have $b=\frac{2}{3}(a+3)-3$. We substitute Equation (2) into Equation (3) to eliminate $a$, to get $b=\frac{2}{3}(c-1)-3$. Substituting this last equation and Equation (2) into Equation (1) to eliminate $a$ and $b$, we have  \[[c-4]+[\frac{2}{3}(c-1)-3]+c=27\] Solving for $c$, we find that $c=13$. Thus, Chris's age is $\boxed{13}$.

When using the distributive property for the first time, we add the product of $x+2$ and $x$ to the product of $x+2$ and 5:

\begin{align*}
(x+2)(x+5) &= (x+2) \cdot x + (x+2) \cdot 5\\
&= x(x+2) + 5(x+2)
\end{align*}We use the distributive property again and combine like terms:

\begin{align*}
x(x+2) + 5(x+2) &= x^2 + 2x + 5x+ 10\\
&= \boxed{x^2 + 7x + 10}
\end{align*}

