problem:
Compute the ordered pair of positive integers $(x,y)$ such that

\begin{align*}
x^y+1&=y^x,\\
2x^y&=y^x+7.
\end{align*}

solution:
We can simply plug in $16^{\frac{1}{2}}=4$ and $625^{\frac{1}{2}}=25$ and get $4-25=-21$. Alternatively, recognizing the problem as a difference of squares, we can rewrite it as \begin{align*}
(16^{\frac{1}{4}})^2-(625^{\frac{1}{4}})^2&=(16^{\frac{1}{4}}-625^{\frac{1}{4}})(16^{\frac{1}{4}}+625^{\frac{1}{4}}) \\
&=(2-5)(2+5)\\
&=(-3)(7)=\boxed{-21}.
\end{align*}

Since we know that $f(x)=x^2+1$ and $g(x)=2x-1$, the expression for $f(g(x))$ is just $(2x-1)^2+1$. From here, we can just plug 5 in as the value for $x$. \begin{align*} (f(g(5))&=(2(5)-1)^2+1
\\ &=(10-1)^2+1
\\ &=(9)^2+1
\\ &=81+1
\\ &=\boxed{82}
\end{align*}

