The value of $E(3)$ is an integer. What is it?

solution:
We can find $x$ by adding twice the first equation to five times the second. From \begin{align*}
2(3x-5y)+5(7x+2y)&=6x+35x\\&=41x,
\end{align*}and \begin{align*}
2(3x-5y)+5(7x+2y)&=2(-11)+5(-12)\\&=-22-60\\&=-82,
\end{align*}we find that $41x = -82$, or $x=-2.$

Substituting into the second equation, we can find $y:$ \begin{align*}
7x+2y&=-12 \\ \implies y&=\frac{1}{2}(-12-7(-2))\\&=\frac{1}{2}(-12+14)\\&=\frac{1}{2}(2)\\&=1.
\end{align*}Thus our answer is $\boxed{(-2,1)}.$

A $y$-intercept is a point on the graph that lies on the $y$-axis, so $x = 0$.  Hence, the number of $y$-intercepts corresponds to the number of real solutions of the quadratic equation $2y^2 - 3y + 7 = 0$.  The discriminant of this quadratic equation is $(-3)^2 - 4 \cdot 2 \cdot 7 = -47$, which is negative, so the quadratic has no real roots.  Therefore, the number of $y$-intercepts is $\boxed{0}$.

