solution:
We extend $QR$ to meet $TS$ at $X$. [asy]
import olympiad;
size(6cm); // ADJUST

pair p = (0, 6);
pair q = (3, 6);

pair r = (3, 3);
pair t = (0, 0);
pair s = (7, 0);
pair x = (3, 0);

draw(p--q--r--s--t--cycle);
draw(r--x);

label("$P$", p, NW);
label("$Q$", q, NE);
label("$R$", r, E + NE);
label("$S$", s, SE);
label("$T$", t, SW);
label("$X$", x, S);

label("$6$", p / 2, W);
label("$3$", p + (q - p) / 2, 2 * N);
label("$3$", x + (r - x) / 2, W);
label("$4$", x + (s - x) / 2, S);
label("$3$", x / 2, S);
label("$3$", r + (q - r) / 2, 2 * E);

draw(rightanglemark(p, t, s));
draw(rightanglemark(t, p, q));
draw(rightanglemark(p, q, r));
add(pathticks(p--q, s=6));
add(pathticks(q--r, s=6));
[/asy] Since $PQ=QR$, then $QR=3$.

Since $PQXT$ has three right angles, it must be a rectangle, so $TX=PQ=3$. Also, $QX=PT=6$.

Since $TS=7$ and $TX=3$, then $XS=TS-TX=7-3=4$.

Since $QX=6$ and $QR=3$, then $RX=QX-QR=6-3=3$.

Since $PQXT$ is a rectangle, then $\angle RXS=90^\circ$.

By the Pythagorean Theorem in $\triangle RXS$, \[ RS^2 = RX^2 + XS^2 = 3^2 + 4^2 = 9+16=25 \]so $RS=5$, since $RS>0$.

Therefore, the perimeter is $$PQ+QR+RS+ST+TP=3+3+5+7+6=\boxed{24}.$$

We write out the first few numbers with a units digit of 7: \[7, 17, 27, 37, 47, 57, 67, 77, 87, 97, 107, 117\] Note how 7 and 17 are prime, but 27 (9 times 3) is not.  37 and 47 are prime, but 57 (3 times 19) is not.  67 is prime, but 77 (7 times 11) is not.  87 has a units sum of 15 which is divisible by 3, so 87 itself is divisible by 3 and thus is not prime.  97 and 107 are prime.  By now, we have found our desired first seven prime numbers.  Their sum is  \begin{align*}
7 &+ 17 + 37 + 47 + 67 + 97 + 107 \\
&= 7+7+7+7+7+7+7 + 10 + 30 + 40 + 60 + 90 + 100 \\
&= 7(7) + 10(1+3+4+6+9+10) \\
&= 49 + 10(33)=\boxed{379}.
\end{align*}

