draw(A--E--D);
label("A", A, SW, sm);
label("B", B, NW, sm);
label("C", C, NE, sm);
label("D", D, dir(0), sm);
label("$9$", (A+B)/2, W, sm);
label("$12$", (B+C)/2, N, sm);
label("$4$", (C+D)/2, dir(0), sm);
label("$5$", (D+E)/2, dir(0), sm);
label("$12$", (A+E)/2, S, sm);
label("$13$", (A+D)/2, N, sm);
draw(rightanglemark(A,B,C,20));
draw(rightanglemark(B,C,D,20));
draw(rightanglemark(D,E,A,20));
[/asy]

