label("$C$",(166,0),S);
[/asy]

solution:
Since $\angle ABC + \angle ABD = 180^\circ$ (in other words, $\angle ABC$ and $\angle ABD$ are supplementary) and $\angle ABD = 130^\circ$, then $\angle ABC = 50^\circ$. [asy]
size(250);
draw((-60,0)--(0,0));
draw((0,0)--(64.3,76.6)--(166,0)--cycle);
