label("$B$",(0,0),S);
label("$D$",(-60,0),S);
label("$C$",(166,0),S);
label("$50^\circ$",(3.5,0),NE);
[/asy] Since the sum of the angles in triangle $ABC$ is $180^\circ$ and we know two angles $93^\circ$ and $50^\circ$ which add to $143^\circ$, then $\angle ACB = 180^\circ - 143^\circ = \boxed{37^\circ}$.

