for (i = -3; i <= 2; ++i) {
  draw(Circle((2*i + 1)/2,1/2));
	P = intersectionpoints(Circle((2*i + 1)/2,1/2),(-2.8,-2.8/5)--(2.8,2.8/5))[0];
	dot(P);
	P = intersectionpoints(Circle((2*i + 1)/2,1/2),(-2.8,-2.8/5)--(2.8,2.8/5))[1];
	dot(P);
}

