	B = (2*i - 2,0);
	draw(interp(A,B,0.2)--interp(A,B,0.7),Arrow(6));
	A = (2*i - 1,1);
	B = (2*i,0);
	draw(interp(A,B,0.2)--interp(A,B,0.7),Arrow(6));
}

