$$q(1)+r(-1) = 4(1)^2+1+4(-1)-1=\boxed{0}.$$

Substituting and expanding, we get
\begin{align*}
x^2 + y^2 + z^2 - xyz &= \left( \frac{b}{c} + \frac{c}{b} \right)^2 + \left( \frac{a}{c} + \frac{c}{a} \right)^2 + \left( \frac{a}{b} + \frac{b}{a} \right)^2 - \left( \frac{b}{c} + \frac{c}{b} \right) \left( \frac{a}{c} + \frac{c}{a} \right) \left( \frac{a}{b} + \frac{b}{a} \right) \\
&= \frac{b^2}{c^2} + 2 + \frac{c^2}{b^2} + \frac{a^2}{c^2} + 2 + \frac{c^2}{a^2} + \frac{a^2}{b^2} + 2 + \frac{b^2}{a^2} - \left( \frac{a^2}{c^2} + \frac{b^2}{c^2} + 1 + \frac{b^2}{a^2} + \frac{a^2}{b^2} + 1 + \frac{c^2}{b^2} + \frac{c^2}{a^2} \right) \\
&= \boxed{4}.
\end{align*}

To approach this problem, we can either use long division or synthetic division to evaluate the quotient of the given rational expression. Alternatively, we can rewrite the numerator as $2x^2 + 3x - 7$ $ = 2x^2 + 3x - 7 - 9x + 9x$ $ = 2x(x-3) + 9x - 7 - 20 + 20$ $ = 2x(x-3) + 9(x-3) + 20$. Hence, $$y = \frac{2x^2 + 3x - 7}{x-3} = \frac{(2x+9)(x-3) + 20}{x-3} = 2x+9 +\frac{20}{x-3}.$$As $x$ approaches infinity or negative infinity, then the fraction approaches $0$, and $y$ approaches $2x + 9$.Thus, $m+b = \boxed{11}.$ [asy]
