real parab (real x) {
  return(x^2 - 8*x + 12);
}

pair A, B, C, D;
real x = -1 + sqrt(5);

A = (4 - x,0);
B = (4 + x,0);
C = (4 + x,-2*x);
D = (4 - x,-2*x);

