Place the ellipse in the coordinate plane, as usual, so that the center is at the origin.  Then the equation of the ellipse is
\[\frac{x^2}{25} + \frac{y^2}{16} = 1.\]Also, the distance from the center to each foci is $\sqrt{5^2 - 4^2} = 3,$ so one foci is at $F = (3,0).$

