problem:
A circle passes through the point $(0,1),$ and is tangent to the parabola $y = x^2$ at $(2,4).$  Find the center of the circle.

[asy]
unitsize(0.4 cm);

real parab (real x) {
  return(x^2);
}

draw(graph(parab,-3.5,3.5));
draw(Circle((-16/5,53/10),13*sqrt(17)/10));

dot((0,1));
dot("$(2,4)$", (2,4), E);
[/asy]

solution:
Complete the square by adding 1 to each side. Then $(x+1)^2 = 1+i=e^{\frac{i\pi}{4}} \sqrt{2}$, so $x+1 = \pm e^{\frac{i\pi}{8}}\sqrt[4]{2}$. The desired product is then
\begin{align*}
\left( -1+\cos\left(\frac{\pi}{8}\right)\sqrt[4]{2} \right) \left( -1-\cos\left( \frac{\pi}{8}\right) \sqrt[4]{2}\right) &= 1-\cos^2\left( \frac{\pi}{8}\right) \sqrt{2} \\
&= 1-\frac{\left( 1 +\cos\left( \frac{\pi}{4}\right) \right)}{2}\sqrt{2}\\
&= \boxed{\frac{1-\sqrt{2}}{2}}.
\end{align*}

problem:
An equilateral triangle $PQR$ is inscribed in the ellipse $\frac{x^2}{a^2} + \frac{y^2}{b^2} = 1,$ so that $Q$ is at $(0,b),$ and $\overline{PR}$ is parallel to the $x$-axis, as shown below.  Also, foci $F_1$ and $F_2$ lie on sides $\overline{QR}$ and $\overline{PQ},$ respectively.  Find $\frac{PQ}{F_1 F_2}.$

[asy]
unitsize(0.4 cm);

pair A, B, C;
pair[] F;
real a, b, c, s;

a = 5;
b = sqrt(3)/2*5;
c = 5/2;
s = 8;

A = (-s/2,-sqrt(3)/2*(s - 5));
B = (0,b);
C = (s/2,-sqrt(3)/2*(s - 5));
F[1] = (c,0);
F[2] = (-c,0);

draw(yscale(b)*xscale(a)*Circle((0,0),1));
draw(A--B--C--cycle);

label("$P$", A, SW);
label("$Q$", B, N);
label("$R$", C, SE);
dot("$F_1$", F[1], NE);
dot("$F_2$", F[2], NW);
[/asy]

solution:
Without loss of generality, assume that $F_1 F_2 = 2,$ so $c = 1.$  Since triangle $QF_1 F_2$ is equilateral, $b = \sqrt{3}$ and $a = 2.$

[asy]
unitsize(0.4 cm);

pair A, B, C, M;
pair[] F;
real a, b, c, s;

a = 5;
b = sqrt(3)/2*5;
c = 5/2;
s = 8;

A = (-s/2,-sqrt(3)/2*(s - 5));
B = (0,b);
C = (s/2,-sqrt(3)/2*(s - 5));
F[1] = (c,0);
F[2] = (-c,0);
M = (A + C)/2;

draw(yscale(b)*xscale(a)*Circle((0,0),1));
draw(A--B--C--cycle);
draw((-a,0)--(a,0));
draw((0,-b)--(0,b));

label("$P$", A, SW);
label("$Q$", B, N);
label("$R$", C, SE);
dot("$F_1$", F[1], NE);
dot("$F_2$", F[2], NW);
label("$c$", (c/2,0), S);
label("$a$", (c/2,b/2), NE);
label("$b$", (0,b/2), W);
label("$M$", M, SW);
[/asy]

Let $s$ be the side length of equilateral triangle $PQR,$ and let $M$ be the midpoint of $\overline{PR}.$  Then $RM = \frac{s}{2}.$  Also, $RF_1 = QR - QF_1 = s - 2,$ so the distance from $R$ to the $x$-axis is $\frac{\sqrt{3}}{2} (s - 2).$

Hence, $R = \left( \frac{s}{2}, -\frac{\sqrt{3}}{2} (s - 2) \right).$  Substituting these coordinates into the equation of the ellipse, we get
\[\frac{(\frac{s}{2})^2}{4} + \frac{(-\frac{\sqrt{3}}{2} (s - 2))^2}{3} = 1.\]This simplifies to $5s^2 = 16s,$ so $s = \frac{16}{5}.$  Therefore,
\[\frac{PQ}{F_1 F_2} = \frac{16/5}{2} = \boxed{\frac{8}{5}}.\]

Denote the ellipse by $\mathcal{E}.$ Let $F_1=(9,20)$ and $F_2=(49,55)$ be its foci, and let $X$ be the point where it touches the $x$-axis.
[asy]
size(6cm);
draw(shift(((9, 20) + (49, 55))/2)*rotate(41.186)*scale(85/2,10*11^.5)*unitcircle); draw((-20,0)--(80,0),EndArrow); draw((0,-20)--(0,85),EndArrow);
dot("$F_1 (9, 20)$", (9, 20), NE);
dot("$F_2 (49, 55)$", (49, 55), NW);
dot("$X$", extension((9, 20), (49, -55), (0, 0), (1, 0)), S);
label("$\mathcal{E}$", (69,30));
label("$x$",(80,-2),SW);
label("$y$",(-2,85),SW);
[/asy]
By definition, $\mathcal{E}$ is the set of all points $P$ for which the quantity $PF_1 + PF_2$ is equal to a particular (fixed) constant, say $k.$ Furthermore, letting $A$ and $B$ be the endpoints of the major axis, we observe that \[AB = AF_1 + F_1B = F_2B + F_1B = k\]since $AF_1 = F_2B$ by symmetry. That is, $k$ is the length of the major axis. Therefore, it suffices to compute the constant $k,$ given that $\mathcal{E}$ is tangent to the $x$-axis.

Note that for points $P$ strictly inside $\mathcal{E},$ we have $PF_1 + PF_2 < k,$ and for points $P$ strictly outside $\mathcal{E},$ we have $PF_1 + PF_2 > k.$ Since the $x$-axis intersects $\mathcal{E}$ at exactly one point $X$ and $XF_1 + XF_2 = k,$ it follows that $k$ is the smallest possible value of $PF_1 + PF_2$ over all points $P$ on the $x$-axis.

Now reflect $F_1$ over the $x$-axis to point $F_1',$ as shown:
[asy]
size(6cm);
draw(shift(((9, 20) + (49, 55))/2)*rotate(41.186)*scale(85/2,10*11^.5)*unitcircle); draw((-20,0)--(80,0),EndArrow); draw((0,-30)--(0,85),EndArrow);
dot("$F_1 (9, 20)$", (9, 20), NE);
dot("$F_1' (9, -20)$", (9, -20), SE);
dot("$F_2 (49, 55)$", (49, 55), NW);
label("$\mathcal{E}$", (69,30));
label("$x$",(80,-2),SW);
label("$y$",(-2,85),SW);
draw((9,20)--(9,-20),dotted);
pair P=(35,0);
dot(P);
label("$P$",P,SE);
draw((9,20)--P--(49,55)--P--(9,-20),dotted);
[/asy]
For a point $P$ on the $x$-axis, we have $PF_1 + PF_2 = PF_1' + PF_2.$ Then, by the triangle inequality, $PF_1' + PF_2 \ge F_1'F_2,$ and equality holds when $P$ lies on segment $\overline{F_1'F_2}.$ Therefore, the smallest possible value of $PF_1 + PF_2$ over all points $P$ on the $x$-axis is $F_1'F_2,$ and so it follows that $k = F_1'F_2.$ Then we compute \[\begin{aligned} F_1'F_2 &= \sqrt{(49-9)^2 + (55-(-20))^2} \\ &= \sqrt{40^2+75^2} \\ &= 5\sqrt{8^2+15^2} \\ &= 5 \cdot 17 \\ &=\boxed{85}. \end{aligned}\]
